To create a web application using React, Node.js, and Express.js, you can follow these steps:

1. Set up the project structure:

Create a new directory for your project and navigate into it:
```
mkdir my-app
cd my-app
```
Initialize a new Node.js project:
```
npm init -y
```
Install the necessary dependencies:
```
npm install express cors body-parser nodemon concurrently
npx create-react-app client
```
2. Set up the server:

Create a new file called `server.js` in the root directory of your project and add the following code:
```javascript
const express = require('express');
const cors = require('cors');
const bodyParser = require('body-parser');

const app = express();

app.use(cors());
app.use(bodyParser.json());

// Add your routes here

const PORT = process.env.PORT || 5000;

app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
```
3. Set up the client:

Navigate to the `client` directory and install the necessary dependencies:
```
cd client
npm install axios
```
Create a new file called `src/App.js` and add the following code:
```javascript
import React from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = React.useState([]);

  React.useEffect(() => {
    axios.get('/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      {data.map(item => (
        <div key={item.id}>
          <h2>{item.title}</h2>
          <p>{item.description}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
```
4. Set up the development environment:

Add the following scripts to your `package.json` file:
```json
"scripts": {
  "start": "node server.js",
  "server": "nodemon server.js",
  "client": "npm start --prefix client",
  "dev": "concurrently \"npm run server\" \"npm run client\""
}
```
5. Deploy the code:

To deploy the code, you can use a service like Heroku. First, create a new Heroku app:
```
heroku create
```
Then, add the Heroku Postgres add-on:
```
heroku addons:create heroku-postgresql:hobby-dev
```
Next, update your `server.js` file to use the Heroku Postgres database:
```javascript
const { Pool } = require('pg');

const pool = new Pool({
  connectionString: process.env.DATABASE_URL,
  ssl: {
    rejectUnauthorized: false
  }
});

// Add your routes here
```
Finally, build the React app and deploy it to Heroku:
```
cd client
npm run build
cd ..
git add .
git commit -m "Deploy to Heroku"
git push heroku master
```

That's it! You now have a web application using React, Node.js, and Express.js that can create, add, and display dummy data. You can also deploy the code to Heroku for production use.

Unfortunately, Swift and iOS do not have a direct equivalent to Android's LayerDrawable. However, you can achieve a similar result using UIView and CALayer. Here's a Swift class that accomplishes the same result:

```swift
import UIKit

class StackedDrawables: UIView {
    private var layers: [CALayer]
    private var iconScale: CGFloat = 0.70
    private var shouldPlaceIcons = true

    init(layers: [CALayer], iconScale: CGFloat = 0.70) {
        self.layers = layers
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        for layer in layers {
            self.layer.addSublayer(layer)
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        if shouldPlaceIcons {
            placeIcons()
        } else {
            shouldPlaceIcons = true
        }
    }

    private func placeIcons() {
        shouldPlaceIcons = false
        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, layer) in layers.enumerated() {
            layer.bounds = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            layer.position = CGPoint(x: bounds.midX, y: bounds.midY)
            switch index {
            case 1:
                layer.frame.origin.y = iconsInset
                layer.frame.origin.x = iconsInset
            case 0:
                layer.frame.origin.y = iconsInset
                layer.frame.origin.x = iconsInset
            default:
                break
            }
        }
    }
}
```

